import { Routes, Route } from 'react-router-dom'
import Home from './components/Home';
import Ecommerce from './pages/EcommerceWebsite/components/Ecommerce';
import Page from './pages/EcommerceWebsite/components/Page';
import Products from './pages/EcommerceWebsite/components/Products';
import CheckOuts from './pages/EcommerceWebsite/components/CheckOuts';  
import './App.css'
import { CartContextProvider } from './pages/EcommerceWebsite/context/CartContext'; 
import { SearchContextProvider } from './pages/EcommerceWebsite/context/SearchContext';

function App() {
  return (
    <SearchContextProvider>
    <CartContextProvider>
      <Routes>
        <Route path='/' element={<Home />}></Route>
        {/* home page for ecommerce website */}
        <Route path='ecommerce' element={<Ecommerce />}></Route>
        {/* goods page for ecommerce website */}
        <Route path='ecommerce/collections' element={<Page />}>
          <Route path='new-arrivals' element={<Products />}></Route>
          <Route path='home-bath' element={<Products />}></Route>
          <Route path='kitchen-dinning' element={<Products />}></Route>
          <Route path='office-craft' element={<Products />}></Route>
          <Route path='personal-goods' element={<Products />}></Route>
        </Route>
        {/* others */}
        <Route path='ecommerce/search' element={<div>search page</div>}></Route>
        <Route path='ecommerce/CheckOuts' element={<CheckOuts /> }></Route>
        <Route path='*' element={<div>Sorry page not found</div>}></Route>
      </Routes>
    </CartContextProvider>
    </SearchContextProvider>
  );
}

export default App;
